        .whole {

            padding: 50px;

            background-color: rgba(168, 0, 118, 0.445);
            border-radius: 15px;
            color: rgba(255, 255, 255, 0.733);

            box-shadow: 5px 5px 10px rgba(255, 255, 255, 0.336);

            display: flex;

            border-radius: 15px;

        }

        }

            color: rgba(255, 255, 255, 0.555);
        }

        #jt-select {
            border: none;
            width: 450px;
            height: 25px;
            border-radius: 9px;
            padding-left: 10px;
            font-size: 10px;
            background-color: rgba(85, 0, 119, 0.616);
            color: rgba(255, 255, 255, 0.61);
            letter-spacing: 5px;
            box-shadow: 5px 5px 10px rgba(255, 255, 255, 0.233);

            transition: all 0.9s;
        }

        #inneritems {
            background-color: rgba(0, 0, 0, 0.877);
            letter-spacing: 5px;
        }

        #jt-select:hover {
            width: 485px;
        }


        #loc-select {
            border: none;
            width: 450px;
            height: 25px;
            border-radius: 9px;
            padding-left: 10px;
            font-size: 10px;
            background-color: rgba(85, 0, 119, 0.562);
            box-shadow: 5px 5px 10px rgba(255, 255, 255, 0.192);

            color: rgba(255, 255, 255, 0.61);
            letter-spacing: 5px;
            transition: all 0.9s;

        }

            background-color: rgba(0, 0, 0, 0.877);
            letter-spacing: 5px;
        }

            width: 485px;
        }

            border: none;
            width: 400px;
            height: 30px;

  color: rgba(255, 255, 255, 0.61);
  letter-spacing: 5px; */

            transition: all 1s;
        }

        #s-range:hover {
            width: 430px;
        }


        input {
            --c: rgba(221, 0, 0, 0.404);
            /* active color */
            --g: 8px;
            /* the gap */
            --l: 5px;
            /* line thickness*/
            --s: 20px;
            /* thumb size*/

            width: 400px;
            height: var(--s);
            /* needed for Firefox*/
            --_c: color-mix(in srgb, var(--c), #e00000 var(--p, 0%));
            -webkit-appearance: none;
            -moz-appearance: none;
            appearance: none;
            background: none;
            cursor: pointer;
            overflow: hidden;
        }

        input:focus-visible,
        input:hover {
            --p: 25%;
        }

        input:active,
        input:focus-visible {
            --_b: var(--s);
        }

        input[type="range" i]::-webkit-slider-thumb {
            height: var(--s);
            aspect-ratio: 1;
            border-radius: 50%;
            box-shadow: 0 0 0 var(--_b, var(--l)) inset var(--_c);
            border-image: linear-gradient(90deg, var(--_c) 50%, #c701c7c7 0) 0 1 / calc(50% - var(--l) / 2) 100vw/0 calc(100vw + var(--g));
            -webkit-appearance: none;
            appearance: none;
            transition: 0.3s;
        }

        #other {
            background-color: rgba(255, 8, 222, 0.473);
            margin-left: 190px;
            color: white;
            padding: 5px;
            border-radius: 5px;
        }

            border: none;
            height: 30px;
            width: 100px;
            border-radius: 15px;
            background-color: transparent;
            color: rgb(184, 184, 184);
            transition: all 1.5s;
            background: linear-gradient(to right, rgba(0, 0, 255, 0.507), rgba(255, 0, 128, 0.541));


        }

        #b-button:hover {
            /* height: 40px; */
            width: 200px;
        }

<body>
    <div class="whole" id="whole">






        <div class="selector1">
            <div class="selector2">

                <div class="jobtype">
                    <a>Job Type</a><br>
                    <select id="jt-select">
                        <option id="inneritems"></option>
                        <option id="inneritems">all</option>
                        <option id="inneritems">full time</option>
                        <option id="inneritems">half time</option>
                    </select>
                </div>

                <div class="location">
                    <a>Location</a><br>
                    <select id="loc-select">
                        <option id="innerloc"></option>
                        <option id="innerloc">chennai</option>
                        <option id="innerloc">kkdi</option>
                    </select>
                </div>

                <div class="range">
                    <a>Salary Range</a><br>
                    <input type="range" id="s-range" min="0" max="100000" value="50000"><br>
                    <k id="other">50000</k>
                </div>

                <div class="button">
                    <button id="b-button">SEARCH</button>
                </div>

            </div>
        </div>

        <div class="datas" id="datas"></div>


    </div>
</body>
<!-- <script src="day12.js"></script> -->
<script>
    let data = [
        {
            title: "web developer",
            type: "full time",
            location: "kkdi",
            salary: 60000,
        },
        {
            title: "web design",
            type: "half time",
            location: "chennai",
            salary: 50000,
        },
        { title: "web devop", type: "full time", location: "kkdi", salary: 40000 },
        {
            title: "web checker",
            type: "half time",
            location: "chennai",
            salary: 30000,
        },
    ];

    let range = document.getElementById("s-range");
    let n = document.getElementById("other");

    range.addEventListener("click", () => {
        let original = range.value;

        n.textContent = original;
    });

    let button = document.getElementById("b-button");
    let jt = document.getElementById("jt-select");
    let loc = document.getElementById("loc-select");
    let amount = document.getElementById("s-range");
    let datas = document.getElementById("datas");

    button.addEventListener("click", () => {
        mainmain();
    });

    function create(jobs) {
        datas.innerHTML = "";

        jobs.forEach((job) => {
            let newdiv = document.createElement("div");
            newdiv.innerHTML = `<h3>Job Name: ${job.title}</h3><br><p>Type: ${job.type}</p><br><p>Location: ${job.location}</p><br><p>Salary: ${job.salary}</p>`;
            datas.append(newdiv);
            console.log(datas);

        });
    }

    function mainmain() {
        let newjt = jt.value;
        let newloc = loc.value.toLowerCase();
        let newamount = parseInt(amount.value);

        const main1 = data.filter((val) => {
            return (
                (newjt === "all" || val.type === newjt) &&
                val.location.includes(newloc) &&
                val.salary >= newamount
            );
        });
        create(main1);
    }

</script>
